import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonGrid, IonRow, IonCol, IonIcon, IonButtons, IonButton } from '@ionic/react';
import React from 'react';
import ExploreContainer from '../components/ExploreContainer';
import '../css/ForgetPassword.css';
import '../css/Global.css';
import { arrowBackOutline } from 'ionicons/icons';
import registeredEmail from '../img/forgetPassword/registeredEmail.png';

const ForgetPassword: React.FC = () => {
    return (
      <IonPage>
        <IonHeader>
          <IonToolbar id="topBar">
            <IonButtons slot="start">
                <IonButton>
                    <IonIcon id="back_button" slot="icon-only" icon={arrowBackOutline} />
                </IonButton>
            </IonButtons>

            <IonTitle id="title">
                Forget Password?  
            </IonTitle>
          </IonToolbar>
        </IonHeader>

        {/* Screen Content*/}
        <IonContent fullscreen style={{display: "flex"}}>
            <IonGrid>
                <IonRow>
                    <IonCol></IonCol>
                    <IonCol size="6" style={{background:"blue"}}>
                        <img id="registeredEmail" src={registeredEmail}></img>
                    </IonCol>
                    <IonCol></IonCol>
                </IonRow>

                <IonRow>
                    <IonCol style={{background:"red"}}>
                        <h5><b>Please enter your registered Email ID.</b></h5>
                    </IonCol>
                </IonRow>
            </IonGrid>
        </IonContent>
      </IonPage>
    );
  };
  
  export default ForgetPassword;
